/*
    Last Updated : afiq (3/2/2025)
    Module : talent payee synch maintenance
    TC101
    Description: Add new US Citizen talent record in the Talents and Right UI screen
    Expected:User should be able to create new US citizen Talent Record and all the information should flow into EPRS Payee screens (payee detail info, tax withholding, address etc)
    */
cy.visit('/adbridge/tal/Talent/Talent#!/Search');
const socialsecurityNo = faker_1.faker.number.int({ min: 100000000, max: 899999999 });
const firstname = 'Automation US Citizen : ';
const lastname = faker_1.faker.person.firstName();
//#region Add New Us Citizen
cy.contains('New Talent').should('be.visible').click();
cy.contains('Continue').should('be.visible').click();
//social sec no
cy.get('[name="ctrl.talent.SocialSecurityNumber"]').type(socialsecurityNo);
//First Name
cy.get('[name="ctrl.talent.FirstName"]').type(firstname);
//last Name
cy.get('[name="ctrl.talent.LastName"]').type(lastname);
//Click Continue
cy.contains('Continue').should('be.visible').click();
const Line1 = faker_1.faker.location.streetAddress();
const Line2 = faker_1.faker.location.secondaryAddress();
const City = faker_1.faker.location.city();
const PostalCode = faker_1.faker.location.zipCode();
const PhoneNumber = faker_1.faker.phone.number('###########');
const EmailAddress = faker_1.faker.internet.email();
//address 1
cy.get('[name="ctrl.talent.Addresses[0].Line1"]').type(Line1);
//address 2
cy.get('[name="ctrl.talent.Addresses[0].Line2"]').type(Line2);
//City
cy.get('[name="ctrl.talent.Addresses[0].City"]').type(City);
cy.get('[name="ctrl.talent.Addresses[0].StateId"]').select('number:1');
//zip
cy.get('[name="ctrl.talent.Addresses[0].Zip"]').type(PostalCode);
//phone no
cy.get('[name="ctrl.talent.PhoneNumber"]').type(PhoneNumber);
//Email
cy.get('[name="ctrl.talent.EmailAddress"]').type(EmailAddress);
//click continue
cy.contains('Continue').should('be.visible').click();
//Tax Field
cy.get('[name="ctrl.talent.TaxMaritalStatus"]').select('Married');
cy.get(':nth-child(2) > .form-group > datepicker-auto.ng-pristine > div > .ng-valid-required').type('1/1/1991');
cy.contains('button', 'Done').should('be.visible').click();
cy.get('[name="ctrl.talent.TaxStateExemptions"]').type('1');
cy.get('[name="ctrl.talent.TaxLocalAuthority"]').type('LHDN');
cy.get('[name="ctrl.talent.TaxFederalDependentDeductionAmount"]').type('200');
cy.get('[name="ctrl.talent._taxStateWithholdingPercent"]').type('10');
cy.get('[name="ctrl.talent.TaxFederalOtherIncome"]').type('200');
cy.get('[name="ctrl.talent.TaxStateFlatWithholding"]').type('20');
cy.get('[name="ctrl.talent.TaxExemptYear"]').type('2025');
cy.contains('Continue').should('be.visible').click();
//create Payee
cy.contains('Create Talent').should('be.visible').click();
cy.wait(5000);
//validate record Same
cy.contains('a.btn-primary', 'Payee').invoke('removeAttr', 'target').click();
//#endregion

