    D. When finished, click Update Sessions to save data and close the window.
10. Enter cast members:
    A. Click Add Cast Member
    B. Enter as much information as possible on the Add/Edit Cast Member Contract screen, at minimum the Name, Union, Contract Type, Category, Camera, Year, Session Location, and Compensation
    C. Click the Save button to save data and close the window.
11. To upload a contract from the cast list, click the paper clip icon in the Actions column.
    A. Click Choose File and select a file from a location on your computer.
    B. Select a type from the drop-down list.
    C. Enter a description.
    D. Click Upload.
    E. Click Close when finished.
12. To upload all contracts at once or to upload any other file to the session report, click the Attachments tab and then click Attach Documents.
